import React, { useState } from 'react';
import './style/signup.css';
import {NavLink} from 'react-router-dom';

const Signup=()=>{

    const [user,setUser]=useState({
        name:"",
        email:"",
        phone:"",
        work:"",
        password:"",
        cpassword:""
    })

    return(
        <React.Fragment>
        <section className="sec">
            <input type="text" placeholder="NAME" value={user.name}/>
            <br/>
            <input type="email" placeholder="EMAIL" value={user.email}/>
            <br/>
            <input type="number" placeholder="PHONE" value={user.email}/>
            <br/>
            <input type="text" placeholder="WORK"/>
            <br/>
            <input type="password" placeholder="PASSWORD"/>
            <br/>
            <input type="password" placeholder="CONFIRM PASSWORD"/>
        </section>
            <NavLink className="links" to="/signup">Already have an account?Login.</NavLink>
            <input type="submit" className="submit" value='SUBMIT'/>
        </React.Fragment>
        );
}

export default Signup;
